import Header from './component/Header';
import Footer from "./component/Footer";
import Card from "./component/Card";
import data from "./data/words.json"
import React from 'react';
import './App.css';

function App() {
  return (
<div>

  <Header/>

   <h1> Карточки слов</h1>
  <React.Fragment>
      {data.map((i) => (
        <Card
          key={i.id}
          english={i.english}
          transcription={i.transcription}
          russian={i.russian}
          tags={i.tags}
        />
      ))}
    </React.Fragment>
     <Footer/>
    </div>
  );
}

export default App;
